Back when i used to compare the super80 to the crj people would always tell me "your going to regret it" and "you'll miss them when they are gone" 
Well.... I guess they were 100% correct about that because I missed an opportunity that I will never get to experience again. The other thing is 
You don't know how good you have it until its gone 
If i would've took those words sincerely when I was 14 im sure it would've been a different story. But now time is passed i can't do anything about it and the past is the past 
There is no use in living life with regrets but this one will always be in the back of my head. 

